pragma solidity ^0.5.0;

contract TicketingContract {

    struct Artist {
        uint256 id;
        address payable owner;
        bytes32 name;
        bytes32 style;
        uint256 ticketsSold;
    }

    struct Venue {
        uint256 id;
        address payable owner;
        bytes32 name;
        //space is measured in squared meters
        uint256 space; 
        //percent of ticket price going to venue
        uint256 percentTaken;
    }

    struct Concert {
        uint256 date;
        uint256 ticketsEmitted;
        uint256 gain;
        uint256 artistId;
        uint256 venueId;
        bool artistCheck;
        bool venueCheck;
    }

    struct Ticket {
        uint256 id;
        address payable owner;
        uint256 price;
        uint256 concertId;
        uint256 trade;
    }

    mapping (uint256 => Artist) private artists;
    mapping (uint256 => Venue) private venues;
    mapping (uint256 => Ticket) private tickets;
    mapping (uint256 => Concert) private concerts;

    uint256 artistCompt;
    uint256 venueCompt;
    uint256 concertCompt;
    uint256 ticketCompt;

    modifier isOwner(address owner) {
      require (msg.sender == owner, "Sender is not the owner");
      _;
  }

  function createArtist(bytes32 _name, bytes32 _type) public {
    artists[artistCompt] = Artist(artistCompt, msg.sender, _name, _type, 0);
    artistCompt ++;
}

function updateArtist(uint256 _id, bytes32 _name, bytes32 _type, uint256 _ticketsSold) public isOwner(artists[_id].owner) {
    artists[_id] = Artist(_id, msg.sender, _name, _type, _ticketsSold);
}

function createVenue(bytes32 _name, uint256 _space, uint256 _percentTaken) public {
    venues[venueCompt] = Venue(venueCompt, msg.sender, _name, _space, _percentTaken);
    venueCompt ++;
}

function updateVenue(uint256 _id, bytes32 _name, uint256 _space, uint256 _percentTaken) public isOwner(venues[_id].owner) {
    venues[_id] = Venue(_id, msg.sender, _name, _space, _percentTaken);
}

function createConcert(uint256 _nbDays, uint256 _artistId, uint256 _venueId) public {
    concerts[concertCompt] = Concert(now + 1 days * _nbDays, 0, 0, _artistId, _venueId, false, false);
    concertCompt ++;
}

function checkArtist(uint256 _concertId) public isOwner(artists[concerts[_concertId].artistId].owner) {
    concerts[_concertId].artistCheck = true;
}

function checkVenue(uint256 _concertId) public isOwner(venues[concerts[_concertId].venueId].owner) {
    concerts[_concertId].venueCheck = true;
}

function emitTicket(uint256 nbTickets, uint256 _concertId) public isOwner(artists[concerts[_concertId].artistId].owner) {
    require(concerts[_concertId].artistCheck == true && concerts[_concertId].venueCheck == true, "Concert is not confirmed by artist and venue");
    concerts[_concertId].ticketsEmitted += nbTickets;
}

function useTicket(uint256 _ticketId) public isOwner(tickets[_ticketId].owner) {
    require(now > (concerts[tickets[_ticketId].concertId].date - 24 * 1 hours) && now < concerts[tickets[_ticketId].concertId].date , "Concert is not within 24 hours");
    delete tickets[_ticketId];
}

function buyTicket(uint256 _concertId, uint256 _artistId, uint256 _price, address payable _owner) public payable {
    require(msg.value == _price, "Amount sent is not equal to ticket price");
    require(now < concerts[_concertId].date, "Concert has already happened");
    require(ticketCompt <= concerts[_concertId].ticketsEmitted, "No more tickets for this concert");

    tickets[ticketCompt] = Ticket(ticketCompt, _owner, _price, _concertId, 0);
    artists[_artistId].ticketsSold ++;
    concerts[_concertId].gain += _price;
    ticketCompt ++;
}

function transferTickets(address payable _newOwner, uint256 _ticketId) public isOwner(tickets[_ticketId].owner) {
    tickets[_ticketId].owner = _newOwner;
}

function cashOut(uint256 _concertId) public payable isOwner(artists[concerts[_concertId].artistId].owner) {
    require(concerts[_concertId].date < now, "Concert has not yet happened");
    uint256 com = venues[concerts[_concertId].venueId].percentTaken;
    msg.sender.transfer(concerts[_concertId].gain * ((100 - com) / 100));
    venues[concerts[_concertId].venueId].owner.transfer(concerts[_concertId].gain * (com / 100));
}

function tradeTicket(uint256 _ticketId, uint256 _price) public isOwner(tickets[_ticketId].owner) {
    require(_price <= tickets[_ticketId].price, "Trading ticket for more than it was bought is forbidden");
    tickets[_ticketId].trade = _price;
}

function rebuyTicket(uint256 _ticketId) public payable {
    require(msg.value == tickets[_ticketId].trade, "Amount sent is not equal to price asked");
    require(tickets[_ticketId].trade != 0, "Ticket is not open for trade");

    tickets[_ticketId].owner.transfer(tickets[_ticketId].trade);
    tickets[_ticketId] = Ticket(_ticketId, msg.sender, tickets[_ticketId].trade, tickets[_ticketId].concertId, 0);
}


}
